import React,{Component} from 'react';
import './Sec.scss';

class Sect01 extends Component {
  render() { 
    return (
     
      <div className="section01">
         <ul>
            <li>
               <a href="#">
                 HTML 
               </a>
            </li>
            <li>
               <a href="#">
                 CSS
               </a>
            </li>  
            <li>
               <a href="#">
                 SCSS
               </a>
            </li>                       
         </ul>
      </div>

    )  
  }
}
export default Sect01;
